class DivideGrid(private var gridPage: PageResult<GridModel>) {
    companion object{
        const val LEVEL_BUILDING = 1 //楼栋
        const val LEVEL_UNIT = 2 //单元
    }
    init {
        build()
    }

    private fun build() {
        if (gridPage != null) {
            if (gridPage.rows != null) {
                this.grids = gridPage.rows
                for (grid in gridPage.rows) { //遍历网格
                    var jsonString=grid.gridRange
                    if(jsonString!=null&&jsonString.length>0){
                        val buildingUnits = Gson().fromJson(jsonString,Array<BuildingUnit>::class.java).asList()
                        grid.children = getBuildings(buildingUnits)//获取网格下面楼栋
                    }
                }
            }
        }
    }

    fun isEmpty():Boolean{
        if(grids!=null&&grids!!.size>0){
            return false
        }
        return true
    }

    /**
     * 获取网格下面的楼栋
     */
    private fun getBuildings(items: List<BuildingUnit>?): List<BuildingUnit> {
        var list = ArrayList<BuildingUnit>()
        if(items==null){
            return list;
        }
        for (item in items) {
            if (item.level == LEVEL_BUILDING) {
                list.add(item)
                var units = getUnits(item, items)
                item.children = units
            }
        }
        return list;
    }

    /**
     * 获取楼栋下面的单元
     */
    private fun getUnits(building: BuildingUnit, items: List<BuildingUnit>): List<BuildingUnit> {
        var list = ArrayList<BuildingUnit>()
        for (item in items) {
            if (building.id.equals(item.parentId) && item.level == LEVEL_UNIT) {
                list.add(item)
            }
        }
        return list;
    }

    var grids: List<GridModel>? = null
}
